import React, { Component } from "react";
import Row from "react-bootstrap/Row";
import InputForm from "./inputForm";
import AnomalyChart from "./anomalyChart";
import "../style.css";

class Controller extends Component {
  constructor(props) {
    super(props);
    this.state = { gotOutput: false };
  }
  moveAnomalies = (report) => {
    console.log(report);
  };
  render() {
    return (
      <React.Fragment>
        <Row>
          <InputForm parentCallback={this.moveAnomalies} />
        </Row>

        {/* <Row>
          <AnomalyChart />
        </Row> */}
      </React.Fragment>
    );
  }
}

export default Controller;
